INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(3, 'Sahrawi goat', 'Sahrawi goat', 'Sahrawi goat', 1, 'Ten different breeds of goats can be found in Egypt. The Barki or Sahrawi is the smallest local breed of goat. The Zaraibi is father to the popular Anglo-Nubian goat bred for it''s healthy milk. Other local breeds include the Sharkawi, Wahati, and Black Sinai. The Saidi and Egyptian Baladi goats  like the ones pictured here - however, are the most abundant.', NULL, NULL, NULL, NULL, NULL, 'The goats were very important to them. They drank the goat''s milk, made heeses ', 'No', 'bringing them back to the tent at night.', 'bringing them back to the tent at night.', , 'http://www.bernadettesimpson.com/goats.html', 'everything', 'everything', 1, '2015-02-24 00:00:00', NULL);
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(4, 'Jabali goat', 'Jabali goat', 'Jabali goat', 1, 'The Jabali mountain goats inhabit the extremly unfriendly and harsh environment of western Syria, where they are kept by different ethnic groups, namely, the Alawits, Druses and Bedouins. The Jabali goat is a black goat, with dropping cars and a curved head; both sexes have horns. A survey was conducted in two different sites, namely, Al-Ghab in Hama district and in As-Sweida district. Forty-three household interviews were carried out to document the current production system. The system can be characterised as a low-input, mixed crop-livestock system. Goat keeping is only of minor importance to the household income compared to crop production or off-farm activities, but provide food in the form of milk, dairy products and meat for the family. Animals are kept on natural pasture most of the year; feed is only supplemented during winter. Farmers emphasise milk production. Milk products like ghee, Shinglish or Jameed are produced for home consumption and for sale.Major constraints mentioned by farmers are government policies for the conservation of forests, feed shortage and limited access to markets because of bad infrastructure and low market prices for their products. The fact that young people migrate to urban areas or work off-farm is seen as potential problem in the near future. (c) 2007 Elsevier Ltd. All rights reserved. ', '< 500', 1, 0, 1, 0, 'Goat keeping is only of minor importance to the household income compared to crop production or off-farm activities, but provide food in the form of milk, dairy products and meat for the family.', 'No', 'The fact that young people migrate to urban areas or work off-farm is seen as potential problem in the near future.', 'Major constraints mentioned by farmers are government policies for the conservation of forests, feed shortage and limited access to markets because of bad infrastructure and low market prices for their products.', , 'https://eurekamag.com/research/021/882/021882640.php', NULL, NULL, 1, '2015-02-24 00:00:00', NULL);
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(5, NULL, 'Arabian leopard', NULL, NULL, 'Are you going on a schooltrip or on vacation with your parents? Let us know if you have seen this beautiful critter and send us your pictures. Perhaps we''ll use your holiday pictures in our next exhibition! Have fun, but be carefull and never approach this animal in the wild!', '< 500', 1, 0, 1, 0, 'The Arabian leopard is a carnivore. This means that he (or she) only eats meat. Most of their preys consist of: Nubian Ibex, Arabian Tahr, Mountain Gazelle, Indian Crested Porcupine, Cape Hyrax, Cape Hare, the foxes, and various partridges may all be hunted by the Arabian leopard. An adult Hamadryas baboon would probably be too difficult for the small Arabian leopard to tackle, but perhaps young baboons are taken where the species'' ranges overlap. It has also been suggested that Arabian Leopards could potentially eat migratory locusts during mass emergences as Snow Leopards have been recorded doing.', 'Are you going on a schooltrip or on vacation with your parents? Let us know if you have seen this beautiful critter and send us your pictures. Perhaps we''ll use your holiday pictures in our next exhibition! Have fun, but be carefull and never approach this animal in the wild!', 'Humans', 'Conservation', , 'https://www.google.be/search?q=Arabian+leopard&hl=nl&rlz=1T4GGHP_nlBE578BE578&source=lnms&tbm=isch&sa=X&ei=Y77xVIvBH4jX7QaiqoDwDw&ved=0CAcQ_AUoAQ&biw=1491&bih=672', 'Sed finibus ex sed laoreet venenatis.', 'Sed nec auctor elit. Nulla maximus purus mi, id laoreet augue convallis eget. Phasellus luctus tincidunt ipsum sit amet sodales. Sed tempus auctor augue ac placerat. Duis dictum sem ut orci tincidunt, vitae consectetur libero faucibus. Aenean vel dui mauris. Aliquam iaculis placerat fermentum. Maecenas ut tellus lacus. In facilisis facilisis erat egestas feugiat. ', 1, '2015-02-28 00:00:00', NULL);
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(6, 'Arabian white oryx', 'Arabian white oryx', 'Arabian white oryx', NULL, 'The Arabian oryx (Oryx leucoryx) or white oryx is a medium-sized antelope with a distinct shoulder bump, long, straight horns, and a tufted tail. It is a bovid, and the smallest member of Oryx genus, native to desert and steppe areas of the Arabian Peninsula. The Arabian oryx was extinct in the wild by the early 1970s, but was saved in zoos and private preserves and reintroduced into the wild starting in 1980.It is strange to think of a large mammal capable of living in intensely hot desert conditions, but the Arabian oryx shows us how successful they can be. This herbivore has a white coat to reflect the sunlight of the day, while its dark legs help absorb heat during cold desert mornings. It can sense rain over long distances and so can find fresh grasses and plants, and will even eat roots when no other forage is available. It feeds during dawn and late afternoon, resting in shaded areas during the mid-day heat. As for water, the Arabian oryx can go for days, and sometimes even weeks without a significant drink, finding enough water by drinking dew that has formed on the plants it eats or from the water content of plants themselves. ', 'approx. 1000 in the wild & 5000-6000 ', 1, 0, 1, 0, 'x; Aristotle and Pliny the Elder held that the	oryx was the unicorn''s "prototype". From certain angles, the oryx may be mistaken as having one horn instead of two, and given that its horns are made from hollow bone which cannot be regrown, if an oryx were to lose one of its horns, for the rest of its life it would have only one horn.', 'No', 'Humans', NULL, , NULL, NULL, NULL, 1, '2015-02-28 00:00:00', NULL);

